	KASRule_Add(TeamName, "Watch_Mission14_ProxDeath_Launch", "Init_Mission14_ProxDeath_CheckProx")
	Init_Mission14_ProxDeath_Launch(TeamName)
	return
	end
	if (_VIFONCE007[TeamName] == 0 and (1 ~= 0)) then  -- "ifonce" #7
	
	_VIFONCE007[TeamName] = 1 --created,set;
	ProxIndex[TeamName] = 0 --created,set
	ShortestDistance[TeamName] = 100000000 --created,set
	TempDist[TeamName] = 0 --created,set
	end
	if (SobGroup_Count("ProxScout") > 0) then     --kasfShipsCount(kasAITeamShipsPtr("ProxScout"))
	
	SobGroup_FillShipsByIndexRange("GrowSelection_ProxTest", "GrowSelection_ProximityFound", ProxIndex[TeamName], 1)    --kasfShipsSelectIndex(kasGrowSelectionPtr("ProxTest"), kasGrowSelectionPtr("ProximityFound"), ___KAS_SCOPED_VAR____ProxIndex_)
