	if (TempDist[TeamName] < ShortestDistance[TeamName]) then
	
	SobGroup_Clear("GrowSelection_ProxClosest")    --kasfGrowSelectionClear(kasGrowSelectionPtr("ProxClosest"))
	KAS_ShipsAdd("GrowSelection_ProxClosest", "GrowSelection_ProxTest")    --kasfShipsAdd(kasGrowSelectionPtr("ProxClosest"), kasGrowSelectionPtr("ProxTest"))
	ShortestDistance[TeamName] = TempDist[TeamName] --set
	end
	ProxIndex[TeamName] = ProxIndex[TeamName] + 1
	elseif (SobGroup_Count("ProxInt") > 0) then     --kasfShipsCount(kasAITeamShipsPtr("ProxInt"))
	
	SobGroup_FillShipsByIndexRange("GrowSelection_ProxTest", "GrowSelection_ProximityFound", ProxIndex[TeamName], 1)    --kasfShipsSelectIndex(kasGrowSelectionPtr("ProxTest"), kasGrowSelectionPtr("ProximityFound"), ___KAS_SCOPED_VAR____ProxIndex_)
	TempDist[TeamName] = KAS_FindDistance(KAS_NamedCentrePosition("GrowSelection_ProxTest"), KAS_NamedCentrePosition(TeamName)) --set    --kasfFindDistance(kasShipsVectorPtr("ProxTest"), kasThisTeamsVectorPtr())
	if (TempDist[TeamName] < ShortestDistance[TeamName]) then
	
	SobGroup_Clear("GrowSelection_ProxClosest")    --kasfGrowSelectionClear(kasGrowSelectionPtr("ProxClosest"))
	KAS_ShipsAdd("GrowSelection_ProxClosest", "GrowSelection_ProxTest")    --kasfShipsAdd(kasGrowSelectionPtr("ProxClosest"), kasGrowSelectionPtr("ProxTest"))
	ShortestDistance[TeamName] = TempDist[TeamName] --set
	end
	ProxIndex[TeamName] = ProxIndex[TeamName] + 1
	end
	
