--
--  "watch" code for Mission14 mission
--
function Watch_Mission14(MissionName)
	--FSM: FSM_Mission14
	--MissionName = "Mission14"
	if (_VIFONCE038 == 0 and (1 ~= 0)) then  -- "ifonce" #38
	
	_VIFONCE038 = 1 --created,set;
	KASTimer_Start(TimerID_LocationCardTimer, 1)
	end
	if (KASTimer_IsExpiredIfSoDestroy(TimerID_LocationCardTimer) ~= 0) then
	
	singlePlayerLocationCard("$61701", 5)    --kasfLocationCard(5000, LSTRING_LocationCard[strCurLanguage])
	end
	if (G_PlayedNis == 0 and KAS_FindEnemiesInside("NISVolume", "GrowSelection_nisVolumeFOUND") ~= 0) then     --kasfFindEnemiesInside(kasVolumePtr("NISVolume"), kasGrowSelectionPtr("nisVolumeFOUND"), 13000)
	
	KASTimer_Start(TimerID_WideScreenInBeforeNIS, 5)
	KAS_SetLetterboxState(2, 3)    --kasfWideScreenIn(90)
	G_PlayedNis = 1 --created,set
	end
	if (KASTimer_IsExpiredIfSoDestroy(TimerID_WideScreenInBeforeNIS) ~= 0) then
	
	KAS_ShipsAdd("GrowSelection_NisCentreShip", "DummyController")    --kasfShipsAdd(kasGrowSelectionPtr("NisCentreShip"), kasAITeamShipsPtr("DummyController"))
	KAS_SetHidden("DummyController", 1)    --kasfHideShips(kasAITeamShipsPtr("DummyController"))
	KAS_SetHidden("MiningBase", 1)    --kasfHideShips(kasAITeamShipsPtr("MiningBase"))
	G_PlayNis = 10 --created,set
	G_NISPlayingNow = 1 --created,set
	KAS_UniversePause(1)    --kasfUniversePause()
	end
	if (_VIFONCE039 == 0 and (G_Nis10Complete ~= 0)) then  -- "ifonce" #39
	
	_VIFONCE039 = 1 --created,set;
	G_NISPlayingNow = 0 --destroyed
	KAS_SetHidden("MiningBase", 0)    --kasfUnhideShips(kasAITeamShipsPtr("MiningBase"))
	KAS_UniversePause(0)    --kasfUniverseUnpause()
	end
	if (_VIFONCE040 == 0 and (1 ~= 0)) then  -- "ifonce" #40
	
	_VIFONCE040 = 1 --created,set;
	KASTimer_Start(TimerID_G_FCHyperspaceSuccessful, 5)
	end
	if (_VIFONCE041 == 0 and (1 ~= 0)) then  -- "ifonce" #41
	
	_VIFONCE041 = 1 --created,set;
	KASTimer_Start(TimerID_G_PlaySensorArrayTechEvent, RandomIntRange(180, 250))    --kasfRandom(180, 250)
	end
	if (_VIFONCE042 == 0 and (G_Nis10Complete ~= 0)) then  -- "ifonce" #42
	
	_VIFONCE042 = 1 --created,set;
	end
	if (_VIFONCE043 == 0 and (G_FleetIntelIntroHasPlayed == 1)) then  -- "ifonce" #43
	
	_VIFONCE043 = 1 --created,set;
	KASObjective_Add(ObjectiveID_DestroyGenny, "$61702", OT_Primary)    --kasfObjectiveCreate("DestroyGenny", LSTRING_FIDestroyGennyTASKBAR[strCurLanguage], LSTRING_FIDestroyGennyTASKBAR[strCurLanguage])
	Objective_SetDescription(ObjectiveID_DestroyGenny, "$60841")
	end
	if (_VIFONCE044 == 0 and (SobGroup_Count("MiningBase") == 0)) then  -- "ifonce" #44    --kasfShipsCount(kasAITeamShipsPtr("MiningBase"))
	
	_VIFONCE044 = 1 --created,set;
	KASObjective_SetState(ObjectiveID_DestroyGenny, 1)    --kasfObjectiveSet("DestroyGenny", 1)
	KAS_PingRemove("MiningBasePING", "$60687")    --kasfPingRemove("MiningBasePING")
	end
	if (_VIFONCE045 == 0 and (G_FIDestroyGatesHasPlayed == 1)) then  -- "ifonce" #45
	
	_VIFONCE045 = 1 --created,set;
	KASObjective_Add(ObjectiveID_DestroyGates, "$61703", OT_Primary)    --kasfObjectiveCreate("DestroyGates", LSTRING_FIDestroyGatesTASKBAR[strCurLanguage], LSTRING_FIDestroyGatesTASKBAR[strCurLanguage])
	Objective_SetDescription(ObjectiveID_DestroyGates, "$60842")
	end

    --
    --delete gate pings as they're destroyed
    --
    if (_VIFONCE997 == 0 and G_GATE1 < 0) then

	    _VIFONCE997 = 1 --created,set;
	    KAS_PingRemove("GATE1PING", "$60688")    --kasfPingRemove("GATE1PING")
    end
    if (_VIFONCE998 == 0 and G_GATE2 < 0) then

	    _VIFONCE998 = 1 --created,set;
	    KAS_PingRemove("GATE2PING", "$60688")    --kasfPingRemove("GATE2PING")
    end
    if (_VIFONCE999 == 0 and G_GATE3 < 0) then

	    _VIFONCE999 = 1 --created,set;
	    KAS_PingRemove("GATE3PING", "$60688")    --kasfPingRemove("GATE3PING")
    end

	if (_VIFONCE046 == 0 and ((G_GATE1 < 0) and (G_GATE2 < 0) and (G_GATE3 < 0))) then  -- "ifonce" #46
	
	_VIFONCE046 = 1 --created,set;
	KASObjective_SetState(ObjectiveID_DestroyGates, 1)    --kasfObjectiveSet("DestroyGates", 1)
	KAS_PingRemove("GATE1PING", "$60688")    --kasfPingRemove("GATE1PING")
	KAS_PingRemove("GATE2PING", "$60688")    --kasfPingRemove("GATE2PING")
	KAS_PingRemove("GATE3PING", "$60688")    --kasfPingRemove("GATE3PING")
	end
	if (_VIFONCE047 == 0 and (KASObjective_GetState(ObjectiveID_DestroyGenny) == 1)) then  -- "ifonce" #47    --kasfObjectiveGet("DestroyGenny")
	
	_VIFONCE047 = 1 --created,set;
	KASTimer_Start(TimerID_G_AllObjectivesComplete, 4)
	end
	if (_VIFONCE048 == 0 and (G_TakeUsHomeEventHasPlayed == 1)) then  -- "ifonce" #48
	
	_VIFONCE048 = 1 --created,set;
	KASObjective_Add(ObjectiveID_Hyperspace, "Hyperspace", OT_Primary)    --kasfObjectiveCreate("Hyperspace", LSTRING_Hyperspace[strCurLanguage], LSTRING_Hyperspace[strCurLanguage])
	Objective_SetDescription(ObjectiveID_Hyperspace, "hyperspace")
	end
	if (_VIFONCE049 == 0 and (G_SensorTechEventHasPlayed == 1)) then  -- "ifonce" #49
	
	_VIFONCE049 = 1 --created,set;
	KAS_UnrestrictResearchOption(0, "SensorArray")    --kasfAllowPlayerToResearch("SensorsArrayTech")
	end
	if (_VIFONCE050 == 0 and (KAS_PlayerHasResearch(0, "CorvetteDrive") ~= 0)) then  -- "ifonce" #50    --kasfDoesPlayerHave("MassDrive10Kt")
	
	_VIFONCE050 = 1 --created,set;
	KAS_UnrestrictResearchOption(0, "CorvetteChassis")    --kasfAllowPlayerToResearch("Chassis2")
	end
	if ((KAS_PlayerHasResearch(0, "CorvetteChassis") ~= 0) and (SetMediumGuns == 0)) then     --kasfDoesPlayerHave("Chassis2")
	
	KAS_UnrestrictResearchOption(0, "HeavyCorvetteUpgrade")    --kasfAllowPlayerToResearch("MediumGuns")
	SetMediumGuns = 1 --created,set
	end
	if (_VIFONCE051 == 0 and (KAS_PlayerHasResearch(0, "FighterChassis") ~= 0)) then  -- "ifonce" #51    --kasfDoesPlayerHave("Chassis1")
	
	_VIFONCE051 = 1 --created,set;
	KAS_UnrestrictResearchOption(0, "CorvetteDrive")    --kasfAllowPlayerToResearch("MassDrive10Kt")
	end
	
end

